import './App.css';
import Navbar from './Components/Navbar';
import sightlogo from "./sightIcon.png";

function HomePage() {
    return (
        <div className='home'>
            <Navbar />
            <div className='Container'>
                <h1>Sight</h1>
                <img src={sightlogo} alt="react logo" />
                This is
            </div>
        </div>
    )
}

export default HomePage;
